import React from 'react';
import CanvasJSReact from '../assets/canvasjs-2.3.1/canvasjs.react';
import './CycleGraph.css';
var CanvasJS = CanvasJSReact.CanvasJS;
var CanvasJSChart = CanvasJSReact.CanvasJSChart;

class CycleGraph extends React.Component {
    render() {
        const options = {
            animationEnabled: true,
            theme:"light2",
            title: {
                text: "Cycle status"
            },
            subtitles: [{
                text: "81% Pass Rate",
                verticalAlign: "center",
                fontSize: 24,
                dockInsidePlotArea: true,

            }],
            data: [{
                type: "doughnut",
                showInLegend: true,

                dataPoints: [
                    { name: "Pass", y: 5 },
                    { name: "CompletedTimout", y: 1 },
                    { name: "Fail", y: 31 },
                    { name: "Completed Terminated", y: 2 }
                ]
            }]
        }
        return (
            <div className="chart">
                <CanvasJSChart options = {options}
                    /* onRef={ref => this.chart = ref} */
                />
                {/*You can get reference to the chart instance as shown above using onRef. This allows you to access all chart properties and methods*/}
            </div>
        );
}
}

export default CycleGraph;
